import React, { useEffect } from 'react'
import { useSelector, useDispatch } from 'react-redux'

const useRatingColiver = () => {
  const dispatch = useDispatch()
  const token = useSelector(s => s.user && s.user.token)
  const ratingcoliver = useSelector(s => s.rating)
  useEffect(() => {
    const setRatingColiver = rating => dispatch({ type: 'rating', ratingcoliver})
    fetch('http://localhost:3300/services', {
      headers: {
        'Authorization': 'Bearer ' + token
      }
    })
      .then(res => res.json())
      .then(data => setRatingColiver(data))
}, [token, dispatch])
  return ratingcoliver
}

const RatingColiver = () => {
  const ratingcolivers = useRAtingColivers()
  if (!ratingcolivers) return 'Cargando ...'
  return (
    <ul>
      {ratingcolivers.map(ratingcolivers =>
        <li key={ratingcoliver}>
          {ratingcoliver}
        </li>
      )}
    </ul>
  )
}

export default RatingColiver
